	@Test
	public void testMultiSinks() throws Exception {
		String[] edges = new String[] { "LINESTRING (339 745, 329 605)", "LINESTRING (374 418, 260 419)",
				"LINESTRING (329 605, 226 574, 260 419)", "LINESTRING (520 518, 705 480)",
				"LINESTRING (520 518, 374 418)", "LINESTRING (329 605, 520 518)", "LINESTRING (260 419, 140 239)" };

		List<Coordinate> sinks = new ArrayList<>();
		sinks.add(new Coordinate(705, 480));
		sinks.add(new Coordinate(140, 239));

		DGraph graph = makeGraph(edges);
		Directionalizer dd = new Directionalizer(getLatLong(),getPropertiesM());
		dd.directionalize(graph, sinks);

		printEdges(graph);
	}

	private DGraph makeGraph(String[] edges) throws ParseException {
		return makeGraph(edges, DirectionType.UNKNOWN);
	}

	private DGraph makeGraph(String[] edges, DirectionType type) throws ParseException {
		int i = 0;
		WKTReader reader = new WKTReader();
		List<EdgeInfo> gedges = new ArrayList<>();
		HashMap<FeatureId, LineString> flows = new HashMap<>();
		for (String e : edges) {
			LineString ls = (LineString) reader.read(e);
			ls = (LineString) ls.reverse();
			EdgeInfo info = new EdgeInfo(ls.getCoordinateN(0),
					ls.getCoordinateN(1),
					ls.getCoordinateN(ls.getCoordinates().length - 2),
					ls.getCoordinateN(ls.getCoordinates().length - 1),
					EfType.SKELETON, new FeatureIdImpl(i + ""), ls.getLength(), type);
			i++;
			gedges.add(info);
			flows.put(info.getID(), ls);
		}

		DGraph graph = DGraph.buildGraphLines(gedges);
		return graph;
	}
	
	private void printEdges(DGraph g) {
		g.edges.forEach(e -> {
			if (e.getID() != null)
				e.print();
		});
	}

	public CoordinateReferenceSystem getLatLong() throws Exception{
		Hints hints = new Hints(Hints.FORCE_LONGITUDE_FIRST_AXIS_ORDER, Boolean.TRUE);
		CRSAuthorityFactory factory = ReferencingFactoryFinder.getCRSAuthorityFactory("EPSG", hints);
		return factory.createCoordinateReferenceSystem("EPSG:4326");
	}

	public CoordinateReferenceSystem getUtm18N() throws Exception{
		return CRS.decode("EPSG:32618");
	}
	
	public CoordinateReferenceSystem getLcc() throws Exception{
		return CRS.decode("EPSG:3348");
	}
	private void directionalize(String[] edges, Coordinate sink, CoordinateReferenceSystem crs, ChyfProperties properties) throws Exception {
		ArrayList<Coordinate> sinks = new ArrayList<>();
		sinks.add(sink);

//		for (String s : edges)
//			System.out.println(s);
//		System.out.println("---");
		
		DGraph graph = makeGraph(edges);
		Directionalizer dd = new Directionalizer(crs, properties);
		dd.directionalize(graph, sinks);

		printEdges(graph);
	}
	
	public 	ChyfProperties getPropertiesM() {
		return getProperties(15, 15);
	}
	public 	ChyfProperties getPropertiesDegree() {
		return getProperties(15, 0.0001);
	}
	public 	ChyfProperties getProperties(double minAngle, double shortedge) {
		ChyfProperties prop = new ChyfProperties();
		prop.setProperty(Property.DIR_ANGLE_DIFF, minAngle);
		prop.setProperty(Property.DIR_SHORT_SEGMENT, shortedge);
		return prop;
	}
